        '<div class="zadanie" id="501" tytul="" typ="1" yt="cdUDeTFxoRY" p="0" lvl="PP2014" pkt="1" typ_v="0" pisz="" odp="1" wsk="" data="2011-05-06"> <div class="z_tresc">Wskaż nierówność, którą spełnia liczba \\(\\pi \\) <div class="blok_odp"> <div><b>A.</b>\\( |x+1|>5 \\)</div> <div><b>B.</b>\\( |x-1|\\lt 2 \\)</div> <div><b>C.</b>\\( \\left |x+\\frac{2}{3} \\right |\\le 4 \\)</div> <div><b>D.</b>\\( \\left |x-\\frac{1}{3} \\right |\\ge 3 \\)</div> </div> </div> <div onclick="pokafilm\(this\)" class="buttons"><div class="player"></div></div> <div class="p_o odpowiedz">C</div> </div> ',
        '<div class="zadanie" id="1266" tytul="" typ="1" yt="swwvyNN-bxc" p="0" lvl="PP2014" pkt="1" typ_v="1" pisz="" odp="1" wsk="" data="2013-11-27"> <div class="z_tresc"> Suma przedziałów \\( \(-\\\infty ,-11\)\\cup \(7,+\\\infty\) \\) jest zbiorem rozwiązań nierówności: <div class="blok_odp"> <div><b>A.</b>\\(|x+1|>10 \\)</div> <div><b>B.</b>\\(|x+2|>9 \\)</div> <div><b>C.</b>\\(|x-2|>11 \\)</div> <div><b>D.</b>\\(|x+1|\\lt 10 \\)</div> </div> </div> <div onclick="pokafilm\(this\)" class="buttons"><div class="player"></div></div> <div class="p_o odpowiedz">B</div> </div> ',
