        '<div class="zadanie" id="308" tytul="" typ="1" yt="w4cOApOPpmy" p="0" lvl="PP2014" pkt="1" typ_v="1" pisz="" odp="1" wsk="" data="2012-05-08"> <div class="z_tresc">Wskaż liczbę, która spełnia równanie \\( |3x+1|=4x \\). <div class="blok_odp"> <div><b>A.</b>\\(x=-1 \\)</div> <div><b>B.</b>\\(x=1 \\)</div> <div><b>C.</b>\\(x=2 \\)</div> <div><b>D.</b>\\(x=-2 \\)</div> </div> </div> <div onclick="pokafilm\(this\)" class="buttons"><div class="player"></div></div> <div class="p_o odpowiedz">B</div> </div> ',
