        '<div class="zadanie" id="908" tytul="" typ="1" yt="MVYcha_Qsaw" p="0" lvl="PP" pkt="1" typ_v="1" pisz="" odp="1" wsk="" data="2013-04-20"> <div class="z_tresc">Zbiorem rozwiązań nierówności <span class="odsu1">\\(\(x-2\)\(x+3\) \\ge 0\\)</span> jest <div class="blok_odp w100"> <div><b>A.</b>\\( \\langle -2, 3 \\rangle \\)</div> <div><b>B.</b>\\( \\langle -3, 2 \\rangle \\)</div> <div><b>C.</b>\\( \( -\\\infty , -3 \\rangle \\cup \\langle 2, +\\\infty \) \\)</div> <div><b>D.</b>\\( \( -\\\infty , 2 \\rangle \\cup \\langle 3, +\\\infty \) \\)</div> </div> </div> <div onclick="pokafilm\(this\)" class="buttons"><div class="player"></div></div> <div class="p_o odpowiedz">C</div> </div> ',
