        '<div class="zadanie" id="405" tytul="" typ="1" yt="sdjRiwcot_J" p="0" lvl="PP" pkt="1" typ_v="1" pisz="" odp="1" wsk="" data="2012-07-26"> <div class="z_tresc">Rozwiązaniem równania \\(\\frac{3x-1}{7x+1}=\\frac{2}{5}\\) jest <div class="blok_odp"> <div><b>A.</b>\\( 1 \\)</div> <div><b>B.</b>\\( \\frac{7}{3} \\)</div> <div><b>C.</b>\\( \\frac{4}{7} \\)</div> <div><b>D.</b>\\( 7 \\)</div> </div> </div> <div onclick="pokafilm\(this\)" class="buttons"><div class="player"></div></div> <div class="p_o odpowiedz">D</div> </div> ',
        '<div class="zadanie" id="102" tytul="" typ="1" yt="AI4KrwcbY7Z" p="0" lvl="PP" pkt="1" typ_v="1" pisz="" odp="1" wsk="" data="2012-02-25"> <div class="z_tresc">Rozwiązaniem równania <span class="ml5 mr4">\\( \\frac{x-3}{2-x}=\\frac{1}{2} \\)</span> jest liczba: <div class="blok_odp"> <div><b>A.</b>\\(-\\frac{4}{3} \\)</div> <div><b>B.</b>\\(-\\frac{3}{4} \\)</div> <div><b>C.</b>\\(\\frac{3}{8} \\)</div> <div><b>D.</b>\\(\\frac{8}{3} \\)</div> </div> </div> <div onclick="pokafilm\(this\)" class="buttons"><div class="player"></div></div> <div class="p_o odpowiedz">D</div> </div> ',
