        '<div class="zadanie" id="638" tytul="" typ="1" yt="gLEcH-XIKHR" p="0" lvl="PP" pkt="1" typ_v="0" pisz="" odp="1" wsk="" data="2011-08-18"> <div class="z_tresc">Która z liczb jest rozwiązaniem równania <span class="odsu">\\(2\(x-1\)+x=x-3\(2-3x\)\\)</span>? <div class="blok_odp"> <div><b>A.</b>\\( \\frac{8}{11} \\)</div> <div><b>B.</b>\\( -\\frac{4}{11} \\)</div> <div><b>C.</b>\\( \\frac{4}{7} \\)</div> <div><b>D.</b>\\( -1 \\)</div> </div> </div> <div onclick="pokafilm\(this\)" class="buttons"><div class="player"></div></div> <div class="p_o odpowiedz">C</div> </div> ',
        '<div class="zadanie" id="639" tytul="" typ="1" yt="0BuHpiTkd2G" p="0" lvl="PP" pkt="1" typ_v="0" pisz="" odp="1" wsk="" data="2011-08-18"> <div class="z_tresc">Która z liczb jest rozwiązaniem równania <span class="odsu">\\(5x-7=0\\cdot \(x+11\)-2\\cdot \(1-3x\)\\)</span>? <div class="blok_odp"> <div><b>A.</b>\\( 5 \\)</div> <div><b>B.</b>\\( -5 \\)</div> <div><b>C.</b>\\( 6 \\)</div> <div><b>D.</b>\\( -1 \\)</div> </div> </div> <div onclick="pokafilm\(this\)" class="buttons"><div class="player"></div></div> <div class="p_o odpowiedz">B</div> </div> ',
